DECLARE
	v_contexto NUMBER := 0;
BEGIN

	v_contexto := pac_contexto.f_inicializarctx(pac_parametros.f_parempresa_t(24,'USER_BBDD'));
	
	DELETE pregunpro
	WHERE sproduc IN (80039, 80040, 80042, 80043)
	AND cpregun IN (623, 4211);

	UPDATE garanpro
	SET norden = norden + 2
	WHERE sproduc BETWEEN 80038 AND 80043
	AND norden >= 9;






	UPDATE pregunprogaran
	SET cpregun = 4210
	WHERE sproduc BETWEEN 80038 AND 80044
	AND cpregun = 4212
	AND cgarant NOT IN (7030, 7050);

	UPDATE pregunprogaran
	SET cpreobl = 1
	WHERE sproduc BETWEEN 80038 AND 80044
	AND cpregun = 4212
	AND cgarant IN (7030, 7050);
	
	
    DELETE garanpro_validacion
	WHERE sproduc BETWEEN 80038 AND 80044
	AND tvalgar LIKE 'pac_propio_garanproval_conf.f_val_capmin%';
	
	DELETE pregunpro
	WHERE sproduc IN (80039, 80040, 80042, 80043)
	AND cpregun IN (623, 4211);
	
	
    COMMIT;
	
END;
